import React, { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";
import {
  Container,
  ConteudoForm,
  ConteudoTitulo,
  BotaoAcao,
  AlertSuccess,
  AlertDanger,
  Form,
  Label,
  Input,
  Titulo,
} from "./styles";

export const EditarPerfil = () => {
  const history = useHistory();
  const [usuario, setUsuario] = useState({
    nome: "",
    email: "",
    senha_atual: "",
    nova_senha: "",
    confirmar_senha: "",
  });

  const [status, setStatus] = useState({
    type: "",
    mensagem: "",
  });

  useEffect(() => {
    const usuarioLogado = localStorage.getItem("usuario");
    if (usuarioLogado) {
      const { nome, email } = JSON.parse(usuarioLogado);
      setUsuario((prev) => ({
        ...prev,
        nome,
        email,
      }));
    } else {
      history.push("/login");
    }
  }, [history]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (usuario.nova_senha && usuario.nova_senha !== usuario.confirmar_senha) {
      setStatus({
        type: "erro",
        mensagem: "As senhas não conferem!",
      });
      return;
    }

    try {
      const response = await fetch("http://localhost:8000/usuarios/perfil", {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          nome: usuario.nome,
          email: usuario.email,
          senha_atual: usuario.senha_atual,
          nova_senha: usuario.nova_senha || null,
        }),
      });

      const data = await response.json();

      if (data.erro) {
        setStatus({
          type: "erro",
          mensagem: data.mensagem,
        });
      } else {
        setStatus({
          type: "success",
          mensagem: "Perfil atualizado com sucesso!",
        });

        // Atualiza os dados no localStorage
        const usuarioAtual = JSON.parse(localStorage.getItem("usuario"));
        localStorage.setItem(
          "usuario",
          JSON.stringify({
            ...usuarioAtual,
            nome: usuario.nome,
            email: usuario.email,
          })
        );
      }
    } catch (error) {
      setStatus({
        type: "erro",
        mensagem: "Ocorreu um erro ao atualizar o perfil!",
      });
    }
  };

  return (
    <Container>
      <ConteudoForm onSubmit={handleSubmit}>
        <ConteudoTitulo>
          <Titulo>Editar Perfil</Titulo>
        </ConteudoTitulo>
        <Form>
          <Label>Nome</Label>
          <Input
            type="text"
            value={usuario.nome}
            onChange={(e) =>
              setUsuario((prev) => ({ ...prev, nome: e.target.value }))
            }
          />
          <Label>Email</Label>
          <Input
            type="email"
            value={usuario.email}
            onChange={(e) =>
              setUsuario((prev) => ({ ...prev, email: e.target.value }))
            }
          />
          <Label>Senha Atual</Label>
          <Input
            type="password"
            value={usuario.senha_atual}
            onChange={(e) =>
              setUsuario((prev) => ({ ...prev, senha_atual: e.target.value }))
            }
          />
          <Label>Nova Senha</Label>
          <Input
            type="password"
            value={usuario.nova_senha}
            onChange={(e) =>
              setUsuario((prev) => ({ ...prev, nova_senha: e.target.value }))
            }
          />
          <Label>Confirmar Senha</Label>
          <Input
            type="password"
            value={usuario.confirmar_senha}
            onChange={(e) =>
              setUsuario((prev) => ({
                ...prev,
                confirmar_senha: e.target.value,
              }))
            }
          />
          <BotaoAcao type="submit">Salvar</BotaoAcao>
        </Form>
      </ConteudoForm>
    </Container>
  );
};
